from voto_invalido vi
inner join 
cidade cid on vi.cidade = cid.id
and cid.nome = 'TUBARÃO'
inner join 
cargo on cargo.id = vi.cargo; 
----QUESTÃO 16
select vi.brancos + vi.nulos as invalidos
from voto_invalido vi
inner join 
cidade cid on vi.cidade = cid.id
and cid.nome = 'TUBARÃO'
inner join 
cargo on cargo.id = vi.cargo
and cargo.nome = 'Prefeito'
group by cargo.nome, invalidos; 

----QUESTÃO 17
select
    cid.nome,
    c.nome,
    v.voto
from
    voto v
inner join
candidato c on
    v.candidato = c.id
inner join
cargo on
    cargo.id = c.cargo
    and cargo.nome = 'Prefeito'
inner join 
cidade cid on
    cid.id = c.cidade
    and cid.nome = 'TUBARÃO'
group by
    cid.nome,
    c.nome,
    v.voto
order by
    v.voto desc;

----QUESTÃO 18
select
    cid.nome,
    c.nome,
    v.voto
from
    voto v
inner join
candidato c on
    v.candidato = c.id
inner join
cargo on
    cargo.id = c.cargo
    and cargo.nome = 'Vereador'
inner join 
cidade cid on
    cid.id = c.cidade
    and cid.nome = 'TUBARÃO'
group by
    cid.nome,c.nome,v.voto
order by
    v.voto desc;

----QUESTÃO 19
select cid.nome, max( v.voto)
from voto v
inner join
candidato c on v.candidato = c.id 
inner join 
cargo on cargo = cargo.id 
and cargo.nome = 'Prefeito'
inner join 
cidade cid on cid.id = c.cidade
and c.cidade = cid.id 
group by cid.nome,c.nome, v.voto
order by v.voto desc; 

----QUESTÃO 20

select p.sigla, sum(v.voto) as votos
from voto v
inner join candidato c on v.candidato = c.id 
inner join cidade cid on c.cidade = cid.id 
and cid.nome = 'TUBARÃO'
inner join partido p on c.partido = p.id
group by p.sigla
order by votos desc;



















